    <div>
          <div className="greeting">
                <div id="home" className="hello">Hello</div><br/>  I<span style={{color : "rgb(212, 140, 176)"}}>'</span>m  <span className="name">Malek</span> <br/> <div className="developer">Web & Mobile Developer</div>
          </div>
